pragma solidity ^0.5.0;

import "./external/BokkyPooBahsDateTimeLibrary.sol";
import "./external/CloneFactory.sol";
import "./Interfaces.sol";

/// @title Recurring Transaction Contract
/// @author Joseph Reed
/// @dev This contract's allows decentralized execution of on-chain recurring tasks. It requires three main components:
///     1. A source for creating transactions requests
///     2. A transaction delegate with the recurring transaction scheduled
///     3. A funded delegated wallet with the transaction delegate set as a delegate
contract RecurringTransaction is IRecurringTransaction, Clone, Payable {

    using BokkyPooBahsDateTimeLibrary for uint;

    IDelegatedWallet public wallet;
    ITransactionDelegate public delegate;
    ITransactionRequest public executor;
    ITransactionRequestFactory public factory;
    uint public currentInterval;
    address public callAddress;
    bytes public callData;
    uint[4] public rtxOptions;          // [callValue,  intervalValue, intervalUnit, maxIntervals]
    uint[7] public txRequestOptions;    // [claimWindow, freezeIntervalDuration, reserveWindowSize, executionWindow, timestamp, callGas, deposit]

    /// @notice Uses 'initialize()' instead of a constructor to make use of the clone
    ///         factory at https://github.com/optionality/clone-factory. In general, 'initialize()' should be
    ///         called directly following the deployment through the use of a factory.
    /// @param _delegate The delegate from which to pull transaction deposits and execute transaction calls
    function initialize (
        IDelegatedWallet _wallet,
        ITransactionDelegate _delegate,
        ITransactionRequestFactory _factory
    ) public requireNotInitialized {
        wallet = _wallet;
        delegate = _delegate;
        factory = _factory;
    }

    /// @notice Collects any ether if it is sent to the contract and otherwise will attempt to execute the transaction
    function () external payable {
        if(msg.value == 0) executeTransaction();
        else emit Deposit_event(msg.sender, msg.value);
    }

    function start (
        address _callAddress,
        bytes memory _callData,
        uint[4] memory _rtxOptions,
        uint[7] memory _txRequestOptions
    ) public onlyDelegates {
        currentInterval = 1;
        callAddress = _callAddress;
        callData = _callData;
        rtxOptions = _rtxOptions;
        txRequestOptions = _txRequestOptions;
        executor = scheduleTransactionRequest();
    }

    /// @notice Cleans up and destroys the alarm. Any leftover ether is sent to the wallet
    function cancel () public onlyDelegates {
        delegate.clear();
        emit Cancel_event(msg.sender);
    }

    /// @notice Destroys this contract after unscheduling. Any leftover ether is sent to the wallet
    function destroy () public onlyDelegates {
        delegate.clear();
        emit Destroy_event(msg.sender);
        selfdestruct(address(wallet));
    }

    function scheduleTransactionRequest () internal returns (ITransactionRequest) {
        uint depositAmount = txRequestOptions[6];
        delegate.transfer(ETHER, address(this), depositAmount);
        ITransactionRequest txRequest = factory.createTransactionRequest.value(depositAmount)(address(wallet), txRequestOptions);
        emit Schedule_event(msg.sender, txRequest);
        return txRequest;
    }

    /// @notice The heart of a recurring transaction
    ///     1. Check if the caller is the current executor
    ///     2. Execute the task
    ///     3. Reschedule the transaction
    function executeTransaction () internal {
        require(msg.sender == address(executor), "msg.sender must be the executor");
        if(rtxOptions[0] > 0) delegate.transfer(ETHER, address(this), rtxOptions[0]);
        (bool success, bytes memory result) = delegate.call(callAddress, rtxOptions[0], callData);
        emit Execute_event(executor, currentInterval, callAddress, callData, rtxOptions, success, result);

        if(currentInterval < maxIntervals() || maxIntervals() == 0) {
            txRequestOptions[4] = getNextTimestamp(txRequestOptions[4], rtxOptions[1], rtxOptions[2]);
            executor = scheduleTransactionRequest();
        }
        else {
            delegate.clear();
            delete executor;
        }

        currentInterval++;
    }

    function getNextTimestamp (uint timestamp, uint intervalValue, uint intervalUnit) public pure returns (uint) {
             if(intervalUnit == 0) timestamp = timestamp.addSeconds(intervalValue);
        else if(intervalUnit == 1) timestamp = timestamp.addMinutes(intervalValue);
        else if(intervalUnit == 2) timestamp = timestamp.addHours(intervalValue);
        else if(intervalUnit == 3) timestamp = timestamp.addDays(intervalValue);
        else if(intervalUnit == 4) timestamp = timestamp.addMonths(intervalValue);
        else if(intervalUnit == 5) timestamp = timestamp.addYears(intervalValue);
        return timestamp;
    }

    function getTimestamp () public view returns (uint) {
        return txRequestOptions[4];
    }

    function maxIntervals () public view returns (uint) {
        return rtxOptions[3];
    }

    function execute () public returns (bool) {
        return executor.execute();
    }

    modifier onlyDelegates () {
        require(wallet.isDelegate(msg.sender), "msg sender must be a delegate");
        _;
    }

    event Cancel_event (address msgSender);
    event Deposit_event(address msgSender, uint msgValue);
    event Destroy_event (address msgSender);
    event Execute_event(
        ITransactionRequest executor,
        uint currentInterval,
        address indexed callAddress,
        bytes callData,
        uint[4] rtxOptions,
        bool success,
        bytes result
    );
    event Uint (uint _uint);
    event Log (uint[7] txRequestOptions);
    event Schedule_event(address indexed delegate, ITransactionRequest txRequest);

}

